import React, { Fragment } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";

const ProfileAbout = ({
  profile: {
    bio,
    skills,
    user: { name },
  },
}) => (
  <div className="profile-about bg-light p-2">
    <h2 className="text-primary">{name} Bio</h2>
    <p>
      Lorem ipsum dolor sit amet consectetur, adipisicing elit. Sed doloremque
      nesciunt, repellendus nostrum deleniti recusandae nobis neque modi
      perspiciatis similique?
    </p>
    <div className="line"></div>
    <h2 className="text-primary">Skill Set</h2>
    <div className="skills">
      {skills.map((item, index) => {
        return (
          <Fragment>
            <div key={index} className="p-1">
              <i className="fa fa-check"></i> {item && <span>{item}</span>}
            </div>
          </Fragment>
        );
      })}
    </div>
  </div>
);

ProfileAbout.propTypes = {
  profile: PropTypes.object.isRequired,
};

export default connect(null, {})(ProfileAbout);
